import React from 'react'
import LinkForm from './LinkForm'

import {db} from '../firebase'

const Links= () => {

    const add = (linkObject) => {
        console.log(linkObject)
        db.collection('links').doc().set(linkObject)
    }

    return <div>
        <LinkForm add= {add} />
        <h1>Links</h1>
    </div>;

}

export default Links;
